var $bm_rt;
var decimals;
function Comma(number) {
    var number2, i;
    if (number < 0) {
        number2 = number.toString().substring(1);
    } else {
        number2 = number;
    }
    number2 = $bm_sum('', Math.floor(number2));
    number = $bm_sum('', Math.floor(number));
    if (number2.length > 3) {
        var mod = $bm_mod(number2.length, 3);
        var output = mod > 0 ? number2.substring(0, mod) : '';
        for (i = 0; i < Math.floor(number2.length / 3); i++) {
            if (mod == 0 && i == 0) {
                output = $bm_sum(output, number2.substring($bm_sum(mod, $bm_mul(3, i)), $bm_sum($bm_sum(mod, $bm_mul(3, i)), 3)));
            } else {
                output = $bm_sum(output, $bm_sum('', number2.substring($bm_sum(mod, $bm_mul(3, i)), $bm_sum($bm_sum(mod, $bm_mul(3, i)), 3))));
            }
        }
        if (number < 0) {
            return $bm_sum('-', output);
        } else {
            return output;
        }
    } else {
        return number;
    }
}
decimals = 0;
var loadup_filling = thisComp.layer('LoadUP! 2').effect('Pseudo/LoadUP_Linear')('Completion %');
$bm_rt = $bm_sum(Comma($bm_sum(0, $bm_div($bm_mul(loadup_filling, 100 - 0), 100))), ' %');
;
